import React, { Component } from "react";
import Bullet from "./Bullet.js";

class Page extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: "",
      note: "",
      completed: false,
      children: []
    }
  }

  componentDidMount() {
    let { currentNote } = this.props.currentNote;
    this.setState({
      currentNote
    });
  }

  render() {
    return (
      <div className="container">
        <h1 className="display-1">{ this.state.currentNote.content }</h1>
        <h1 className="display-5">{ this.state.currentNote.note }</h1>
        <hr></hr>
        {
          this.state.currentNote.children.map(child =>
            <Bullet bullet={ child }></Bullet>
          )
        }
      </div>
    )
  }
}

export default Page;
